('2423','23','6109-1','Finca Rual',Null,'Finca zum Ausbauen für Hotel Rural, Hotel-Sanatorium oder Reiterhof','34017','Die Finca gleich einem Gutherrenhof und besteht schon in seinen Grundmauern seit 1578. Das Grundstück befindet sich nur 10 Min von Palma und 10 Min von einem Golfplatz entfernt. Ideal für Investoren, die ein Hotel Rural oder ein Hotel Sanatorium erstellen möchten. Die konstruierte Fläche beträgt ca 4.000m² und die Grundstücksfläche liegt bei ca 316.800m². Weitere 825.000m² Nachbargrundstück ohne Gebäude kann noch dazu erworben werden.\r\n\r\nPläne, einen Besichtigungstermin des Objektes, sowie weitere Informationen erhalten Sie bei uns im Büro bei Vorlage eines Bonitätsnachweises und Angabe Ihrer Postanschrift.\r\n','34018','4650000','106','2016-01-27 13:01:20','106','2016-01-27 13:02:07',Null,'2558','105','1168',1,'1','0',Null,Null,Null,'34019',Null,'0','0','0',Null,'2016-01-27 13:08:10',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'34020',Null,'34021',Null,'34022',Null,'34023','971.779.243    636.842.893','34024','0',0,'0');
